let { catchWrongCaller } = require("./exceptionHelper.js")
const SenryuNFT = artifacts.require("./SenryuNFT")

contract("SenryuNFT testing, check whether the contract can be deployed", accounts => {
  it("...should assert true", async () => {
    const senryuNFTInstance = await SenryuNFT.deployed()
    return assert.isTrue(!!senryuNFTInstance)
  });
});

contract("SenryuNFT testing, a transfer takes place once mintNFT(...) is called with an empty token URI", accounts => {
  it("...should successfully mint an nft", async () => {
    const senryuNFTInstance = await SenryuNFT.deployed()
    let tokenId = await senryuNFTInstance.mintNFT({}, { from: accounts[0] })
    receipt = tokenId["receipt"]
    assert.equal(receipt['logs'][0]['event'], "Transfer", "The nft should be minted with an empty metadata.")
  });
});

contract("SenryuNFT testing, a transfer takes place once mintNFT(...) is called", accounts => {
  it("...should successfully mint provided an appropriately formatted metadata (1).", async () => {
    const senryuNFTInstance = await SenryuNFT.deployed();
    const nft1 = {
      image: "data:image/png;base64,",
      description: "a senryu nft minted (1)",
    }

    let tokenId = await senryuNFTInstance.mintNFT(nft1, { from: accounts[0] })
    receipt = tokenId["receipt"]
    assert.equal(receipt['logs'][0]['event'], "Transfer", "The nft should be minted with an appropriate metadata, sending a transfer event.")
  });

  contract("SenryuNFT testing, a NFTMinted event takes place once mintNFT(...) is called", accounts => {
    it("...should successfully mint provided an appropriately formatted metadata (2) and emit event.", async () => {
      const senryuNFTInstance = await SenryuNFT.deployed();
      const nft2 = {
        image: "data:image/png;base64, ACAgBISAEhIAQEAJCQAgIASHQAQRE0DswCGqCEBACQkAICAEhIASEgBAQAkJACAgBEXTNASEgBISAEBACQkAICAEhIASEgBAQAh1AQAS9A4OgJggBISAEhIAQEAJCQAgIASEgBISAEBBB1xwQAkJACAgBISAEhIAQEAJCQAgIASHQAQRE0DswCGqCEBACQkAICAEhIASEgBAQAkJACAgBEXTNASEgBISAEBACQkAICAEhIASEgBAQAh1AQAS9A4OgJggBISAEhIAQEAJCQAgIASEgBI",
        description: "a senryu nft minted (2)",
      }
  
      let tokenId = await senryuNFTInstance.mintNFT(nft2, { from: accounts[0] })
      receipt = tokenId["receipt"]
      assert.equal(receipt['logs'][1]['event'], "NFTMinted", "The NFTMinted event should be published.")
      assert.equal(receipt['logs'][1]['args']['tokenId'], 1, "The event should have the expected tokenId.")
      assert.equal(receipt['logs'][1]['args']['unlockerAddress'], accounts[0], "The event should have the expected unlockerAddress.")
    })
  })

  contract("SenryuNFT testing, an error should return once mintNFT(...) is called not by its owner", accounts => {
    it("...should successfully catch wrong caller", async () => {
      const senryuNFTInstance = await SenryuNFT.deployed();
      await catchWrongCaller(senryuNFTInstance.mintNFT({}, { from: accounts[1] }))
    })
  })
})
